import React from "react";
import { Row } from "reactstrap";
import NotificationTableRow from "./notification-table-row.js";
const data = [
  {
    id: "1",
    sender: "mollaahmadi",
    type: "buy-list",
    "target-group": "mollaahmadi-family",
    "buy-list": [
      {
        id: "1",
        name: "شامپو تخم مرغی صحت",
        description: "نداشت نگیر"
      },
      {
        id: "2",
        name: "سس گوجه فرنگی",
        description: "فقط دلپذیر باشه ها"
      }
    ]
  },
  {
    id: "2",
    sender: "mahlagha",
    type: "join-to-my-group",
    "target-group": "hamsayeha",
    "buy-list": []
  },
  {
    id: "3",
    sender: "ali",
    type: "join-me-to-other-group",
    "target-group": "itc",
    "buy-list": []
  },
  {
    id: "4",
    sender: "sepanta",
    type: "disjoin-from-my-group",
    "target-group": "khabgah",
    "buy-list": []
  },
  {
    id: "5",
    sender: "mahlagha",
    type: "disjoin-me-from-other-group",
    "target-group": "غضنفر و دوستان",
    "buy-list": []
  }
];
class NotificationTable extends React.Component {
  render() {
    const rows = [];
    data.foreach(row => {
        rows.push(<NotificationTableRow data={row} />);
    });
    return (
      <Row className="notification-table">
      {rows}
      </Row>
    );
  }
}

export default NotificationTable;
